import React from 'react';
import { Card } from 'react-bootstrap';

const Image = (props) => {
    return ( 
        <Card style={{ width: '18rem' }} className='mx-auto mb-2'>
        <Card.Img variant="top" src={props.picture} />
        <Card.Body>
            <Card.Title>{props.name}</Card.Title>
        </Card.Body>
        </Card>
     );
}

export default Image;
